import defaultStringifyOptions from './defaultStringifyOptions.js';
import expandAndMergeOptions from './expandAndMergeOptions.js';

export default function stringify(records, options) {
	options = expandAndMergeOptions(defaultStringifyOptions, options);
	const lines = Array.from(stringifyRecords(records, options));
	lines.push(''); // For trailing newline
	return lines.join(options.newline);
}

function* stringifyRecords(records, options) {
	for (const record of records) {
		for (const line of stringifyRecord(record, options)) {
			yield line.filter((x) => x !== undefined).join(options.separator);
		}
	}

	if (options.end) yield options.end;
}

export default function stringifyA1(record, options) {
	const {reference, identifier} = record;

	const parts = ['A1', reference, identifier];

	if (options.trailing.A1) parts.push('');

	return parts;
}

import stringifySex from './stringifySex.js';
import stringifyDate from './stringifyDate.js';

export default function stringifyA2(record, options) {
	const {
		reference,
		patient: {nn, lastname, firstname, sex, birthdate},
	} = record;

	const sexstring = stringifySex(sex, options);
	const datestring = stringifyDate(birthdate, options);

	const parts = ['A2', reference, lastname, firstname, sexstring, datestring];

	if (options.nnInA2 && nn) parts.push(nn);

	if (options.trailing.A2) parts.push('');

	return parts;
}

export default function stringifyA3(record, options) {
	const {
		reference,
		patient: {streetandnumber, zip, municipality},
	} = record;

	const parts = ['A3', reference, streetandnumber, zip, municipality];

	if (options.trailing.A3) parts.push('');

	return parts;
}

